import React,{Component} from 'react';


class TopNavRight extends Component {
     
    render() {
        return (
                <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12">
                    <ul>
                        <select id="basic" className="selectpicker show-tick form-control"placeholder="تسجيل الدخول" title="register">
                            <TopNavRightIcon href="login.html" title="register" option="سجل هنا"/>
                            <TopNavRightIcon href="register.html" title="register" option="الاشتراك"/>
                        </select>
                        <i className="fas fa-users"></i>
                    <TopNavRightIcon />
                    <TopNavRightIcon />
                    <TopNavRightIcon />
                    </ul>
                </div>
        )
    };
}
export default TopNavRight;
